using System;
using System.Collections.Generic;
using System.Text;
using System.Text.RegularExpressions;

namespace Chain.Common
{
	public class StringPlus
	{
		private const string strInitial = "";

		public static List<string> GetStrArray(string str, char speater, bool toLower)
		{
			List<string> list = new List<string>();
			string[] array = str.Split(new char[]
			{
				speater
			});
			string[] array2 = array;
			for (int i = 0; i < array2.Length; i++)
			{
				string text = array2[i];
				if (!string.IsNullOrEmpty(text) && text != speater.ToString())
				{
					string item = text;
					if (toLower)
					{
						item = text.ToLower();
					}
					list.Add(item);
				}
			}
			return list;
		}

		public static string[] GetStrArray(string str)
		{
			return str.Split(new char[44]);
		}

		public static string GetArrayStr(List<string> list, string speater)
		{
			StringBuilder stringBuilder = new StringBuilder();
			for (int i = 0; i < list.Count; i++)
			{
				if (i == list.Count - 1)
				{
					stringBuilder.Append(list[i]);
				}
				else
				{
					stringBuilder.Append(list[i]);
					stringBuilder.Append(speater);
				}
			}
			return stringBuilder.ToString();
		}

		public static List<string> GetSubStringList(string o_str, char sepeater)
		{
			List<string> list = new List<string>();
			string[] array = o_str.Split(new char[]
			{
				sepeater
			});
			string[] array2 = array;
			for (int i = 0; i < array2.Length; i++)
			{
				string text = array2[i];
				if (!string.IsNullOrEmpty(text) && text != sepeater.ToString())
				{
					list.Add(text);
				}
			}
			return list;
		}

		public static string DelLastComma(string str)
		{
			return str.Substring(0, str.LastIndexOf(","));
		}

		public static string DelLastChar(string str, string strchar)
		{
			return str.Substring(0, str.LastIndexOf(strchar));
		}

		public static string ToSBC(string input)
		{
			char[] array = input.ToCharArray();
			for (int i = 0; i < array.Length; i++)
			{
				if (array[i] == ' ')
				{
					array[i] = '\u3000';
				}
				else if (array[i] < '\u007f')
				{
					array[i] += 'ﻠ';
				}
			}
			return new string(array);
		}

		public static string ToDBC(string input)
		{
			char[] array = input.ToCharArray();
			for (int i = 0; i < array.Length; i++)
			{
				if (array[i] == '\u3000')
				{
					array[i] = ' ';
				}
				else if (array[i] > '＀' && array[i] < '｟')
				{
					array[i] -= 'ﻠ';
				}
			}
			return new string(array);
		}

		public static string GetCleanStyle(string StrList, string SplitString)
		{
			string result;
			if (StrList == null)
			{
				result = "";
			}
			else
			{
				string text = StrList.Replace(SplitString, "");
				result = text;
			}
			return result;
		}

		public static string GetNewStyle(string StrList, string NewStyle, string SplitString, out string Error)
		{
			string result;
			if (StrList == null)
			{
				result = "";
				Error = "请输入需要划分格式的字符串";
			}
			else
			{
				int length = StrList.Length;
				int length2 = StringPlus.GetCleanStyle(NewStyle, SplitString).Length;
				if (length != length2)
				{
					result = "";
					Error = "样式格式的长度与输入的字符长度不符，请重新输入";
				}
				else
				{
					string text = "";
					for (int i = 0; i < NewStyle.Length; i++)
					{
						if (NewStyle.Substring(i, 1) == SplitString)
						{
							text = text + "," + i;
						}
					}
					if (text != "")
					{
						text = text.Substring(1);
					}
					string[] array = text.Split(new char[]
					{
						','
					});
					string[] array2 = array;
					for (int j = 0; j < array2.Length; j++)
					{
						string s = array2[j];
						StrList = StrList.Insert(int.Parse(s), SplitString);
					}
					result = StrList;
					Error = "";
				}
			}
			return result;
		}

		public static bool IsRightfulMobiles(string mobiles)
		{
			string[] array = mobiles.Split(",".ToCharArray());
			string pattern = "^1[3|4|5|8]\\d{9}$";
			string[] array2 = array;
			for (int i = 0; i < array2.Length; i++)
			{
				string input = array2[i];
				if (!Regex.IsMatch(input, pattern))
				{
					return false;
				}
			}
			return true;
		}

		public static bool IsRightfulMobile(string mobile)
		{
			string pattern = "^1[3|4|5|8]\\d{9}$";
			return Regex.IsMatch(mobile, pattern);
		}

		public static double Round(double d, int i)
		{
			if (d >= 0.0)
			{
				d += 5.0 * Math.Pow(10.0, (double)(-(double)(i + 1)));
			}
			else
			{
				d += -5.0 * Math.Pow(10.0, (double)(-(double)(i + 1)));
			}
			string text = d.ToString();
			string[] array = text.Split(".".ToCharArray());
			int num = text.IndexOf(".");
			string str = array[0];
			string text2 = (array.Length > 1) ? array[1] : "";
			if (text2.Length > i)
			{
				text2 = text.Substring(num + 1, i);
			}
			string s = str + "." + text2;
			d = double.Parse(s);
			return d;
		}

		public static string ProcessString(string input)
		{
			return Regex.Replace(input, "['\"\\\\\\[\\]\\{\\}]", "");
		}

		public static string ConvertToFirstPinYin(string strText)
		{
			if (strText == null || strText.Length == 0)
			{
				return strText;
			}
			StringBuilder stringBuilder = new StringBuilder();
			for (int i = 0; i < strText.Length; i++)
			{
				char c = strText[i];
				if (c >= '一' && c <= '龥')
				{
					stringBuilder.Append("".Substring((int)(c - '一'), 1));
				}
				else if (c >= '!' && c <= '~')
				{
					stringBuilder.Append(c.ToString());
				}
			}
			return stringBuilder.ToString();
		}

		public static string HtmlEncode(string input)
		{
			input = input.Replace(">", "&gt;");
			input = input.Replace("<", "&lt;");
			input = input.Replace(" ", "&nbsp;");
			input = input.Replace("\"", "&quot;");
			input = input.Replace("'", "&#39;");
			input = input.Replace("\n", "<br />");
			return input;
		}

		public static string HtmlDecode(string input)
		{
			input = input.Replace("<br />", "\n");
			input = input.Replace("&gt;", ">");
			input = input.Replace("&lt;", "<");
			input = input.Replace("&nbsp;", " ");
			input = input.Replace("&quot;", "\"");
			input = input.Replace("&#39;", "'");
			return input;
		}
	}
}
